            return [
              feature.geometry.coordinates[1],

            ];
          });

        function style_HDBBranchesgyms2(feature) {
            var context = {
                feature: feature,
                variables: {}
            };
            // Start of if blocks and style check logic
            if (HDBBranchesgyms2rule0_eval_expression(context)) {
              return {
                pane: 'pane_HDBBranchesgyms2',
